import { AppBar, Toolbar, IconButton, Typography, Button } from "@material-ui/core";

const about = ()=>{
    return(<div>

      
     <AppBar position="fixed" color="primary" elevation="0" className="a1 a2">
        <Toolbar>
          <img src="data:image/svg+xml;base64," alt="Slatemates Live" className="a5" />
        </Toolbar>

        <Tabs
        value={value}
        indicatorColor="primary"
        textColor="primary"
        onChange={handleChange}
        aria-label="disabled tabs example"
      ></Tabs>
      </AppBar>
        
        <style jsx>{`
          .a1{
            margin-bottom: 0;
            background-color: #fff;        
          }
          .a2{
            padding: 0;
          }
          .a5 {
            height: 2.5em;
        }
         
        `}</style>
    </div>)
}

export default about;
